import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Container, Row, Col } from "react-bootstrap";

export default class Logo extends React.Component {
  render() {
    return (
      <Row>
        <Col style={{ fontSize: "30px" }}>&lt;JB /&gt;</Col>
      </Row>
    );
  }
}
